
class Solution:
    # @param haystack, a string
    # @param needle, a string
    # @return a string or None
    def strStr(self, haystack, needle):
        m = len(haystack)
        n = len(needle)
        if not n:
            return haystack

        i = 0
        while i <= m - n:
            k = i
            j = 0
            while j < n and haystack[k] == needle[j]:
                k += 1
                j += 1
            if j == n:
                return haystack[i:]
            i += 1

        return None

if __name__ == "__main__":
    s = Solution()

    assert s.strStr('abc', 'ab') == 'abc'
    assert s.strStr('abc', 'bc') == 'bc'
    assert s.strStr('abc', 'bcd') == None















